import React from 'react';

function Theme(setTheme) {
    const onClick = (e) => {
        const { value } = e.target;
        setTheme(value);
    }

    return (
        <div className="color" onChange={onClick()}>
            <div className="red" value="theme-red"></div>
            <div className="orange" value="theme-orange"></div>
            <div className="yellow" value="theme-yellow"></div>
            <div onClick={() => setTheme('green')} className="green" value="theme-green"></div>
            <div onClick={() => setTheme('blue')} className="blue" value="theme-blue"></div>
            <div onClick={() => setTheme('indigo')} className="indigo" value="theme-indigo"></div>
            <div onClick={() => setTheme('violet')} className="violet" value="theme-violet"></div>
            <div onClick={() => setTheme('grey')} className="black" value="theme-grey"></div>
        </div>
    )
}

export default Theme;
